import React from 'react';
import { BrowserRouter as Router, Route,Routes} from 'react-router-dom';
import '';
import Home from './pages/Home';
import Test from './pages/test';


function App() {
  return (
    <Router>
      <div className="App">

        <Routes>
          <Route path="/" element={<Home />} />
          <Route path="/test" element={<Test />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
